import React from "react";
import { useParams } from "react-router-dom";

function Character() {
  let { name } = useParams();

  return (
    <div>
      <h1>Personnage : {name}</h1>
      <p>Informations sur le personnage {name}.</p>
    </div>
  );
}

export default Character;
